import React, { useState } from 'react';
import { IonButton, IonButtons, IonContent, IonHeader, IonInput, IonItemDivider, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab2.css';
import { RouteComponentProps } from 'react-router';

const Tab2: React.FC<RouteComponentProps> = (props) => {

  const [text, setText] = useState<string>();

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Explore</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonItemDivider>
          <IonInput value={text} placeholder="SearchClubs" onIonChange={e => setText(e.detail.value!)}></IonInput>
        </IonItemDivider>
      </IonContent>
    </IonPage>
  );
};

export default Tab2;
